package com.byzoro.version1;import com.byzoro.FileSources;import javax.jws.WebParam;import javax.jws.WebService;import javax.jws.soap.SOAPBinding;/** * @author huanyuguo * @date 2018/4/27 7:37 */@WebService@SOAPBinding(style = SOAPBinding.Style.RPC)public interface UploadFileInterface {    public String AlarmInform(@WebParam(name = "cameraID") String cameraId,                              @WebParam(name = "fileName") String fileName,                              @WebParam(name = "alarmType") String alarmType,                              @WebParam(name = "alarmTime") String alarmTime,                              @WebParam(name = "fileSources") FileSources fileSources) throws Exception;}